/*Table structure for table `T_LEAVE` */

DROP TABLE IF EXISTS `T_LEAVE`;

CREATE TABLE `T_LEAVE` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '请假流程主键',
  `PROCESS_INSTANCE_ID` varchar(64) DEFAULT NULL COMMENT '对应流程实例id',
  `USER_ID` varchar(20) DEFAULT NULL COMMENT '请假人',
  `START_TIME` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '申请请假开始时间',
  `END_TIME` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '申请请假结束时间',
  `LEAVE_TYPE` varchar(20) DEFAULT NULL COMMENT '请假种类',
  `APPLY_TIME` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '申请时间',
  `REALITY_START_TIME` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '实际请假开始时间',
  `REALITY_END_TIME` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '实际请假结束时间',
  `REASON` varchar(2000) DEFAULT NULL COMMENT '请假事由',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=18 DEFAULT CHARSET=utf8;

